import React from 'react'
import { secondSection } from '../global/Data'

function About() {
    return (
        <section
            className='my-[30px] lg:mt-[100px]'
            data-aos='fade-left'
              data-aos-delay='400'
        >
            <div className='container mx-auto px-20'>

                {/* Each About */}
                <div className='flex flex-col justify-center items-center shadow-md'>

                    {secondSection.map((item, idx) => {
                        return (
                            <div className='flex flex-row space-x-3'>
                                <div>{item.title}</div>
                                <div>{item.subtitle}</div>
                            </div>
                        )
                    })}
                </div>
            </div>
        </section>
    )
}

export default About
